            <label class="col-md-9 text-info form-label">{{section[field].label}}</label>
            <div class="col-md-3">
                <div class="btn-group">
                    <button type="button" dynamic-name="field" btn-radio="obj.value"
                            ng-disabled="!formEnabled || section[field].spldisable" ng-model="section[field].value"
                            ng-selected="section[field].value=={{obj.value}}" ng-repeat="obj in section[field].values"
                            ng-required="section[field].required &amp;&amp; section[field].enabled"
                            class="btn btn-default">{{obj.label}}
                    </button>
                </div>
                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.required"
                    class="help-block">Required
                </div>
            </div></div></script>
        <script id="tfiFile" type="text/ng-template">
            <div
            ng-class="{'has-error': dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty}" class="row form-group">
            <label class="col-md-5 text-info form-label">{{section[field].label}}</label>
            <div class="col-md-7">
                <div s3-upload bucket="'tfiapp'" dynamic-name="field" ng-model="section[field].value"
                     s3-upload-options="{getOptionsUri: '/s3options', folder: 'images/'}"
                     ng-focus="OnMouseOver(section[field])"
                     ng-required="section[field].required &amp;&amp; section[field].enabled"></div>
                <div ng-if="section[field].value" class="row img-responsive"><img dynamic-src="section[field].value"
                                                                                  class="userImage"></div>
                <span>PNG/JPEG file format only</span>

                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.required"
                    class="help-block">Required
                </div>
            </div></div></script>
