<div id="page">
    <div class="componentTemplates">
        <script id="tfiText" type="text/ng-template">
            <div
            ng-class="{'has-error': dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty}" class="row form-group">
            <label class="col-md-5 text-info form-label">{{section[field].label}}</label>
            <div class="col-md-7"><input type="text" ng-model="section[field].value" dynamic-name="field"
                                         ng-pattern="{{section[field].regex}}"
                                         ng-required="section[field].required &amp;&amp; section[field].enabled"
                                         ng-focus="OnMouseOver(section[field])" class="form-control input-form">

                <div class="row">
                    <div
                        ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.required"
                        class="col-md-12 help-block">Required
                    </div>
                    <div
                        ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.pattern"
                        class="col-md-12 help-block">{{section[field].regexError}}
                    </div>
                    <div ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$error.compareInvalid"
                         class="col-md-12 help-block">{{section[field].compare.message}}
                    </div>
                </div>
            </div></div></script>
        <script id="tfiDate" type="text/ng-template">
