                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.compareInvalid"
                    class="col-md-12 help-block">{{section[field].compare.message}}
                </div>
            </div></div></script>
        <script id="tfiDat" type="text/ng-template">
