            ng-class="{'has-error': dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty}" class="row form-group">
            <label class="col-md-5 text-info form-label">{{section[field].label}}</label>
            <div class="col-md-6">
                <div class="input-group"><input type="text" data-start-view="2"
                                                data-min-view="{{section[field].minView}}" data-autoclose="1"
                                                data-date-type="date" bs-datepicker ng-model="section[field].value"
                                                dynamic-name="field" data-date-format="dd/MM/yyyy"
                                                ng-required="section[field].required &amp;&amp; section[field].enabled"
                                                ng-focus="OnMouseOver(section[field])"
                                                class="input-form form-control"><span class="input-group-addon plain"><i
                            class="fa-calendar fa"></i></span></div>
                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.required"
                    class="help-block">Required
                </div>
                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.date"
                    class="help-block">Invalid Date. Please enter date in dd/mm/yyyy.
                </div>
                <div
                    ng-show="dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty &amp;&amp; dynamicForm[field].$error.compareInvalid"
                    class="col-md-12 help-block">{{section[field].compare.message}}
                </div>
            </div></div></script>
        <script id="tfiDat" type="text/ng-template">
