            ng-class="{'has-error': dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty}" class="row form-group">
            <label class="col-md-5 text-info form-label">{{section[field].label}}</label>
            <div class="input-group col-md-5"><input type="text" is-open="opened" min-date="minDate"
                                                     max-date="'2015-06-22'" datepicker-options="dateOptions"
                                                     date-disabled="disabled(date, mode)" close-text="Close"
                                                     class="input-form form-control">
                <button ng-click="open($event)" class="input-group-addon plain"><i class="fa-calendar fa"></i></button>
            </div></div></script>
        <script id="tfiPicklist" type="text/ng-template">
