                    {{section[field].label}}</p></div>
            <div class="row marginMedium"></div></div></script>
        <script id="tfiFieldset" type="text/ng-template">
            <div
            class="legend tfiBlueDark">{{section[field].label}}
            <hr class="small-top"></div></script>
        <script id="tfiRadio" type="text/ng-template">
            <div
            ng-class="{'has-error': dynamicForm[field].$invalid &amp;&amp; dynamicForm[field].$dirty}" ng-focus="OnMouseOver(section[field])" class="row form-group">
            <label class="col-md-5 text-info form-label">{{section[field].label}}</label>
            <div class="col-md-7">
                <div class="btn-group">
                    <button type="button" dynamic-name="field" btn-radio="obj.value" ng-model="section[field].value"
                            ng-selected="section[field].value=={{obj.value}}" ng-repeat="obj in section[field].values"
