                     s3-upload-options="{getOptionsUri: '/s3options', folder: 'images/'}"
                     ng-focus="OnMouseOver(section[field])"
                     ng-required="section[field].required &amp;&amp; section[field].enabled"></div>
                <div ng-if="section[field].value" class="row img-responsive"><img dynamic-src="section[field].value"
